INSERT INTO `h_detail_organisasi` (`id`, `nama_organisasi`, `tentang_kami`, `visi`, `misi`, `navbar_bg`, `navbar_text`, `image`, `daftar`) VALUES
(1, 'HMPTI UDB', 'Himpunan Mahasiswa Prodi Teknik Informatika (HMPTI) Fakultas Ilmu Komputer Universitas Duta Bangsa Surakarta yang bertempat di Kota Surakarta Provinsi Jawa Tengah.', 'Menjadikan Himpunan Mahasiswa Program Studi Teknik Informatika (HMPTI) sebagai himpunan mahasiswa yang berkualitas, unggul, serta aktif berperan meningkatkan kualitas pendidikan mahasiswa Teknik Informatika dengan menyalurkan potensi mahasiswa Teknik Informatika dalam bidang akademik.', '1. Menyesuaikan keadaan organisasi sehingga mampu selaras dengan kondisi mahasiswa Teknik Informatika.\r\n2. Menjalankan kegiatan sesuai dengan program kerja yang ada untuk menyalurkan aspirasi mahasiswa serta menampung kreativitas mahasiswa/i dalam bidang teknologi informatika.\r\n3. Memberi wadah bagi mahasiswa/i Teknik Informatika yang memiliki potensi dalam suatu bidang.\r\n4. Mengembangkan kemampuan mahasiswa Teknik Informatika untuk memiliki jiwa wirausaha dengan memanfaatkan teknologi yang ada.\r\n5. Menjalin komunikasi yang baik dantara pengurus agar tercipta suasana kekeluargaan yang harmonis.\r\n6. Memepererat relasi mahasiswa Teknik Informatika baik relasi internal antara mahasiswa/i Teknik Informatika maupun relasi eksternal dengan program studi lain.', '#FFFFFF', '#3F3C3C', 'logo.png?1624943673', 1);
INSERT INTO `h_divisi` (`id_divisi`, `nama_divisi`, `logo`, `deskripsi`) VALUES
(10, 'Ketua & Wakil Ketua', NULL, 'Ketua berperan mengoordinasikan seluruh kegiatan, menyusun rencana kegiatan, menyusun laporan pelaksanaan kegiatan, dan memimpin rapat. Wakil Ketua berperan membantu pelaksanaan tugas Ketua dan menjalankan peran Ketua saat Ketua berhalangan.'),
(11, 'Sekretaris', NULL, 'Sekretaris adalah anggota (pengurus) yang mengemban tugas tulis-menulis, atau surat-menyurat.'),
(12, 'Bendahara', NULL, 'Bendahara sebagai penanggung jawab (pemegang) atau pengurus keuangan.'),
(13, 'Divisi Riset dan Teknologi', NULL, 'Divisi yang berperan dalam memunculkan inovasi-inovasi dengan melakukan riset dan pengembangan.'),
(14, 'Divisi KOMINFO', NULL, 'Media dan Informasi adalah divisi yang bergerak dalam bidang multimedia dan berfungsi sebagai media penyebaran informasi di lingkup HMTI serta media sosial.'),
(15, 'Divisi Minat dan Bakat', NULL, 'Minat dan Bakat adalah divisi yang berfungsi sebagai wadah yang menaungi minat dan bakat para mahasiswa aktif Teknik Informatika Universitas Duta Bangsa, terutama di bidang teknologi.'),
(152, 'Divisi Humas', NULL, 'Divisi Hubungan Masyarakat , menjalankan tugas menyalurkan aspirasi dan sosialisasi di msyarakat');
