ase/ubuntu-18.04.6-server-amd64.iso\">https://cdimage.ubuntu.com/releases/18.04/release/ubuntu-18.04.6-server-amd64.iso</a></p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\"><br>\r\n\r\n</p>\r\n\r\n<p style=\"line-height: 108%; margin-bottom: 0.11in\"><style type=\"text/css\">p { line-height: 115%; margin-bottom: 0.1in; background: transparent }a:link { color: #000080; so-language: zxx; text-decoration: underline }</style><br><br></p><p style=\"line-height: 100%; margin-bottom: 0in\"><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.1in; direction: ltr; background: transparent }</style></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; margin-bottom: 0.1in; background: transparent }a:link { color: #000080; so-language: zxx; text-decoration: underline }</style></p>', 1, 'FANDI AZIZ PRATAMA', 1661342088, 0, 0, 1, '', 'Email, No Whatsapp', '<p>\r\n\r\n \r\n \r\n \r\n \r\n\r\n\r\nTerimakasih sudah mendaftar, silahkan join grup whatsapp kami\r\ndi <a href=\"https://chat.whatsapp.com/JCvhkoxdXAI9mhYivX0lJP\" target=\"_blank\">chat.whatsapp.com</a></p>'),
