INSERT INTO `h_proker` (`id_proker`, `judul`, `waktu`, `id_status`, `deskripsi`, `id_divisi`) VALUES
(6, 'Rapat Bulanan Pengurus HMP TI', 'Hari Sabtu Minggu Ke - 4', '2', 'Menjalin kordinasi sesama anggota HMP agar\r\nterbentuknya chemistry sesama anggota. Rapat dilakukan setiap sabtu minggu ke-4 dipimpin\r\nlangsung ketua HMP, evaluasi bulanan, planning bulan\r\nselanjutnya, penyampaian pendapat anggota.', 10),
(7, 'Rapat Kerja HMP TI 2021', 'Sabtu, 22 Januari 2022', '0', 'Merencanakan strategi pelaksaanan organisasi dalam\r\nwaktu satu tahun kedepan sehingga terwujudnya visi dan\r\nmisi dari organisasi. Rapat kerja dilaksanakan secara daring melalui platform\r\ngoogle meet, dimana setiap peserta wajib menyalakan\r\nkamera. Setiap peserta dilarang meninggalkan tempat\r\ntanpa ijin.', 10),
(9, 'MUBES awal periode', 'Awal Periode Menjabat', '4', 'Membahas AD/ART HMPTI, Membahas GBHO, Ketua dan Wakil ketua HMPTI Membacakan AD/ART. Peserta MUBES berdiskusi GBHO dan Lainnya. Bila ada yang keberakatan anggota boleh mengusulkan\r\npendapatnya. MUBES Awal Tahun dihadiri minimal 2/3 dari\r\npengurus HMPTI. Hasil disahkan oleh Presidium. Sidang Pleno Awal Periode diatur dalam peraturan\r\ntersendiri.', 10),
(10, 'MUBES Akhir periode', 'Akhir periode', '3', 'membahas evaluasi kinerja HMPTI dalam 1 periode, membahas laporan pertanggungjawaban setiap\r\npengurus, setiap pengurus\r\nmenyampaikan laporan\r\npertanggungjawaban selama satu periode, setiap pengurus mengevaluasi kinerja dari pengurus lain', 10),
(11, 'MAKRAB', 'Fleksibel', '4', 'Mengakrabkan antar pengurus,\r\nMeningkatkan rasa persatuan dan kebersamaan antar\r\npengurus,\r\nMembangun kesadaran berorganisasi', 10),
(12, 'Pengeluaran Nomor Administrasi', 'Selama masa kepengurusan', '2', 'Mengeluarkan\r\nnomor\r\nsurat,\r\nproposal,\r\ndan\r\nLaporan\r\nPertanggungjawab\r\nan sebagai bentuk\r\nketeraturan dan\r\nkerapihan\r\nadministrasi\r\ndalam\r\nKesekretariatan\r\nHMPTI.', 11),
(13, 'Pengarsipan Surat Masuk dan Surat Keluar', 'Di akhir bulan, Setiap tanggal 28', '2', 'Sebagai dokumen\r\nterhadap\r\nsurat\r\nmasuk dan keluar\r\ndalam\r\nkesekretariatan\r\nsehingga\r\nterciptanya\r\nketeraturan dan\r\nkerapian dalam\r\nadministrasi\r\nkepengurusan.', 11),
(14, 'Membuat Struktur Kepengurusan HMPTI', '23 Januari 2021', '4', 'Sebagai bentuk\r\npengenalan dan\r\nmenciptakan\r\nketeraturan\r\norganigram dalam kepengurusan', 11),
(15, 'Pendataan Inventaris Kesekretariatan', 'Di akhir periode masa kepengurusan', '3', 'Sebagai bentuk\r\nmenjaga barang-\r\nbarang yang ada\r\ndi\r\ndalam\r\nkesekretariatan\r\nagar\r\nterdata,\r\nterjaga dan tertata\r\nrapi.', 11),
(16, 'Pembuatan Notulensi setelah rapat', 'Setiap melakukan rapat', '2', 'Sebagai\r\nbukti\r\nterlaksananya\r\nrapat\r\nrutin\r\nHMPTI,\r\ndan\r\nmencatat\r\nhasil\r\nrapat.', 11),
(17, 'Daftar Kehadiran Pengurus pada Kegiatan Rapat', 'Setiap melakukan rapat', '2', 'Sebagai\r\npengontrol\r\nkehadiran setiap\r\nanggota HMPTI\r\nketika rapat', 11),
(18, 'Kas Bulanan', 'Minggu ke-2 dalam 1 bulan', '4', 'Kas bulanan bertujuan untuk menambah dana tambahan\r\nuntuk keperluan dalam HMP TI', 12),
(19, 'Membuat laporan keuangan', '1x dalam 3 bulan', '4', '1. Mengetahui nominal dana keseluruhan secara detail \r\n2. Tercipta nya tertib administrasi keuangan', 12),
(20, 'Kaleidoskop', '1 periode', '2', 'Penjadwalan hari-hari besar nasional, universitas dan\r\ndokumentasi setiap kegiatan HMPTI. Bertujuan untuk setiap kegiatan dan segala bentuk\r\ninformasi terkait HMPTI dapat dapat tersampaikan dan\r\nterdokumentasi secara teratur.', 14),
(21, 'Konten Kreatif', '1 Periode', '2', 'Microblog adalah konten yang berisi informasi singkat mengenai suatu topik terutama topik seputar teknik informatika, yang berisi tulisan seperti blog dalam bentuk pendek dan dikemas dalam sebuah desain kreatif.', 14),
(22, 'Microblog', '1 Periode', '2', 'Pembuatan konten kreatif tentang IT yang diambil dari beberapa blog/website yang telah disimpulkan menjadi singkat', 14),
(24, 'Mobile Legend E-Sport Tournament', 'Maret', '3', 'Tournament Mobile Legend. Mencari dan mengembangkan esport di universitas duta\r\nbangsa.', 15),
(25, 'Maintenance Website / Pengembangan Website', 'Juli', '4', 'Membuat Todo List yaitu status proker, Status proker dapat diubah oleh Pengurus HMPTI dan dapat dilihat di halaman devisi.', 13),
